  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'SSH 连接报错'
};
export const metadata = {
  "id": "rke/troubleshooting/ssh-connectivity-errors/_index",
  "title": "SSH 连接报错",
  "description": "### Failed to set up SSH tunneling for host [xxx.xxx.xxx.xxx]: Can't retrieve Docker Info",
  "source": "@site/docs/rke/troubleshooting/ssh-connectivity-errors/_index.md",
  "permalink": "/docs/rke/troubleshooting/ssh-connectivity-errors/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rke/troubleshooting/ssh-connectivity-errors/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
  /* @jsx mdx */

export const rightToc = [{
  value: 'Failed to set up SSH tunneling for host xxx.xxx.xxx.xxx: Can&#39;t retrieve Docker Info',
  id: 'failed-to-set-up-ssh-tunneling-for-host-xxxxxxxxxxxx-cant-retrieve-docker-info',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h3 {...{
      "id": "failed-to-set-up-ssh-tunneling-for-host-xxxxxxxxxxxx-cant-retrieve-docker-info"
    }}>{`Failed to set up SSH tunneling for host `}{`[xxx.xxx.xxx.xxx]`}{`: Can't retrieve Docker Info`}</h3>
    <h4 {...{
      "id": "failed-to-dial-to-varrundockersock-ssh-rejected-administratively-prohibited-open-failed"
    }}>{`Failed to dial to /var/run/docker.sock: ssh: rejected: administratively prohibited (open failed)`}</h4>
    <ul>
      <li parentName="ul">{`没有访问 Docker socket 的权限，请登录主机，运行`}<inlineCode parentName="li">{`docker ps`}</inlineCode>{`检查权限：`}</li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`ssh -i ssh_privatekey_file user@server
user@server$ docker ps
CONTAINER ID        IMAGE               COMMAND                  CREATED             STATUS              PORTS                    NAMES
`}</code></pre>
    <p>{`请参考`}<a parentName="p" {...{
        "href": "https://docs.docker.com/install/linux/linux-postinstall/#manage-docker-as-a-non-root-user"
      }}>{`如何以非 root 用户角色管理 Docker`}</a>{`，正确配置您的权限。`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`如果您使用的操作系统是 RedHat 或 CentOS，您不能使用 root 用户连接节点，因为这两种系统有这个 bug`}<a parentName="p" {...{
            "href": "https://bugzilla.redhat.com/show_bug.cgi?id=1527565"
          }}>{`Bugzilla #1527565`}</a>{`。您需要添加一个用户，然后为它配置访问 Docker socket 的权限。详情请参考`}<a parentName="p" {...{
            "href": "/docs/rke/os/_index"
          }}>{`RKE OS Requirements`}</a>{`。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`SSH server 的版本低于 v6.7。通过 SSH 连接 Docker socket 需要用到 v6.7 或以上的 SSH server。您可以运行`}<inlineCode parentName="p">{`sshd -V`}</inlineCode>{`命令检查当前主机使用的 SSH server 版本，或使用 netcat 命令检查 SSH server 版本，如下方示例代码所示，请将“xxx.xxx.xxx.xxx”替换为主机 IP 地址：`}</p>
      </li>
    </ul>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`nc xxx.xxx.xxx.xxx 22
SSH-2.0-OpenSSH_6.6.1p1 Ubuntu-2ubuntu2.10
`}</code></pre>
    <h4 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-error-configuring-ssh-ssh-no-key-found"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: Error configuring SSH: ssh: no key found`}</h4>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`无法访问密钥文件`}<inlineCode parentName="p">{`ssh_key_path`}</inlineCode>{`。请检查您是否已经指定了密钥文件，检查执行 `}<inlineCode parentName="p">{`rke`}</inlineCode>{` 命令的用户是否有权限访问这个密钥文件。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`密钥文件`}<inlineCode parentName="p">{`ssh_key_path`}</inlineCode>{`异常。运行`}<inlineCode parentName="p">{`ssh-keygen -y -e -f private_key_file`}</inlineCode>{`命令，检查密钥文件是否有效。该命令的返回消息包括了公钥和私钥，如果私钥失效，该命令会返回报错消息。`}</p>
      </li>
    </ul>
    <h4 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-ssh-handshake-failed-ssh-unable-to-authenticate-attempted-methods-none-publickey-no-supported-methods-remain"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: ssh: handshake failed: ssh: unable to authenticate, attempted methods `}{`[none publickey]`}{`, no supported methods remain`}</h4>
    <ul>
      <li parentName="ul">{`密钥文件`}<inlineCode parentName="li">{`ssh_key_path`}</inlineCode>{`不正确。请检查节点使用的密钥文件是否为`}<inlineCode parentName="li">{`ssh_key_path`}</inlineCode>{`，然后检查您是否指定了正确的用户使用这个密钥通过 SSH 连接。`}</li>
    </ul>
    <h4 {...{
      "id": "failed-to-dial-ssh-using-address-xxxxxxxxxxxxxx-error-configuring-ssh-ssh-cannot-decode-encrypted-private-keys"
    }}>{`Failed to dial ssh using address `}{`[xxx.xxx.xxx.xxx:xx]`}{`: Error configuring SSH: ssh: cannot decode encrypted private keys`}</h4>
    <p>{`如果您想使用加密的私钥，您应该使用`}<inlineCode parentName="p">{`ssh-agent`}</inlineCode>{`命令加载密钥和密钥短语（passphrase）。您可以在命令行工具输入`}<inlineCode parentName="p">{`--ssh-agent-auth`}</inlineCode>{`命令，配置 RKE 使用这个 agent。它会在运行`}<inlineCode parentName="p">{`rke`}</inlineCode>{`命令的环境中使用`}<inlineCode parentName="p">{`SSH_AUTH_SOCK`}</inlineCode>{`环境变量。`}</p>
    <h4 {...{
      "id": "cannot-connect-to-the-docker-daemon-at-unixvarrundockersock-is-the-docker-daemon-running"
    }}>{`Cannot connect to the Docker daemon at unix:///var/run/docker.sock. Is the docker daemon running?`}</h4>
    <ul>
      <li parentName="ul">{`无法连接节点，请检查配置的地址`}<inlineCode parentName="li">{`address`}</inlineCode>{`和端口`}<inlineCode parentName="li">{`port`}</inlineCode>{`是否有误。`}</li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
